description:
WinCatalog 2013 indexes disks, files, and folders for finding files and data without having to reach for the original disk: Hard Disk, Pen Drive, Network Drive, CD, DVD, or other.
Save your time using disk catalog software!

Stop wasting time looking for a file, archived document, or a digital photo stored on a hundred disks from your growing collection! Simply process your disks with WinCatalog once, and you'll be able to find any file from the collection in a matter of seconds!
